import { useState } from "react";
import Box from './addProduct'


export default function App() {
  const [show, setShow] = useState(true);
  return (
    <div className="App">
      <Box status={show} />
      <button onClick={() => setShow(!show)}>
        {show ? "Hide" : "Show"} component
      </button>
    </div>
  );
}
